import React from 'react'

const SearchBar = (props) => {
    return (
        <div class="md-form mt">
            <input class="form-control" type="text" placeholder="Search" aria-label="Search" />
            <button class="btn">Search</button>
        </div>
    )
}

export default SearchBar;
